  final float[] polyX = new float[4];
  final float[] polyY = new float[4];
  polyX[0] = (float)box.minX;
  polyY[0] = (float)box.minY;
  polyX[1] = (float)box.minX;
  polyY[1] = (float)box.minY;
  polyX[2] = (float)box.minX;
